import Header from "./Header";

const layoutStyle = {
  display: "flex",
//   justifycontent: "spaced-between",
  margin: 20,
  padding: 100,
  border: "1px solid #DDD"
};

const withLayout = Page => {
  return () => (
    <div style={layoutStyle}>
      <Header />
      <Page />
    </div>
  );
};

export default withLayout;
